INSERT INTO `faqs` (`id`, `question`, `description`) VALUES
(1, 'When does an Orthopedic second opinion make sense?123', '<ul><li>When your doctor doesn’t have the required specialist knowledge for your condition.</li><li>When various doctors have given you different recommendations and you need help making a decision.</li><li>When you haven’t received a clear diagnosis or therapy recommendation.</li><li>When your surgeon has recommended a major operation and you want to make sure that it’s the best way to help you.</li><li>When you feel that you haven’t been given enough information about your planned treatment.</li><li>When the suggested treatment promises no significant improvement to your condition.</li><li>When you want to find out if there are other treatment options you can pursue.</li></ul>'),
(2, 'Am I putting my relationship with my current doctor at risk?', 'Getting a second opinion is a simple routine part of medicine. In fact, your physician may also be seeking one or more additional opinions. Doctors ask their colleagues for consults and advice/opinions all the time. Sometimes a fresh pair of eyes and a new perspective help if you’ve had a long-standing relationship with a patient. Many patients think that seeking a second opinion somehow indicates a lack of trust, rather than a desire to confirm what their doctor has told them and explore opinions their doctor either might not have access to or be aware of.'),
(3, 'What joints are included? What about Spine injuries or problems?', 'The joints covered include: shoulders, elbows, wrists, hands, fingers, hips, knees and ankles. Unfortunately, spine injuries are not covered for consultations.'),
(4, 'How long will it take for me to receive my opinion / consultation?', 'Once we receive all the information, we will respond within 2 days.'),
(5, 'Who will review my information?', 'All of your information will be reviewed by a fellowship-trained orthopedic surgeon.'),
(6, 'How much does it cost?2', '<p>After you sign up or log in and provide all the information needed regarding your consultation, you have the choice to pick from written report analysis, phone consult and video consult.</p><h4>Written report analysis ($100):</h4><p>If you would like more clarification regarding the radiology report and imaging then you will choose this option. You will be given a written report within 48 hours of what your diagnosis is based on the radiology report or imaging and treatment options both non-surgical and surgical. The cost of the written report analysis is $100.</p><h4>Phone Call Consultation ($300):</h4><p>If you would like to speak to an orthopedic surgeon after you have uploaded and entered all of your information then pick phone visit. You will be able to speak to an orthopedic surgeon regarding your diagnosis, imaging and go over non-surgical and surgical treatment plans and any other questions or concerns that you may have. The phone consult will last 15 minutes and only include 1 area/joint of concern. The cost of this phone consult is $300. If you would like to discuss multiple areas/joints, the cost increases $100/joint.</p> <h4>Video Consultation ($500):</h4><p>If you would like a more in-depth consultation regarding your injury then select video visit. You will be able to discuss diagnosis, imaging treatment and the orthopedic surgeon will be able to do a limited physical exam to help you decide your treatment plan. The cost of a video visit is $500.</p> <h4>Follow up Visit ($150)</h4> <p class=\"mb-0\">Follow up visit: If you have been seen by SecondLook Ortho for a specific joint and would like to set up a follow up visit for that joint. The cost will be $150 The follow up visit is only by phone consultation.</p>');
